import './about.scss';
import {useState, useEffect} from 'react';
import ButtonIconMd from '../Components/Button/ButtonIconMd';
import documentIcon from './img/document.svg';
import resume from './blakeStagnerResume.pdf';
import { findRenderedDOMComponentWithClass } from 'react-dom/test-utils';

function About() {
    const [skills, setSkills] = useState(0)

    const resumeView = () => {
        console.log('test')
        window.open(resume, "_blank")
    }

    const rainAnimation = () => {
        let rainArea = document.querySelector('#rain-container')

     
    }

    const indicator = (evt) => {
        const section = document.querySelector('#section');
        const sectionChildren = section.childNodes.length;
        const sectionChildrenWidth = section.getBoundingClientRect().width
        const sectionWidth = sectionChildrenWidth * sectionChildren;


        let carouselPositions = [];
        document.querySelectorAll('#section > div').forEach(function(div) {
        let child = div.getBoundingClientRect()
        carouselPositions.push([child.left ]);

        })

        for(let i in carouselPositions) {
            if(carouselPositions[i] > -100 && carouselPositions[i] < 100) {
                setSkills(parseInt(i))
            }
        }

    }
    window.addEventListener('load', () => {
        const section = document.querySelector('#section');
        section.addEventListener('scroll', indicator)
    })

    const handleClick = (num) => {
        const section = document.querySelector('#section');
        const sectionChildrenWidth = section.getBoundingClientRect().width;

        setSkills(num);
        section.scrollTo({
            left: num * sectionChildrenWidth,
            behavior: 'smooth'
          });
    }

    return (
        <div id="about">
            <div className="main-container">
                <div className="heading">
                    <h1>About</h1>
                    <h2>Technical Skills</h2>
                    <span
                        className={''} 
                        id="blue-animation2"></span>
                </div>
                <div className="about-container">
                    <Language />
                    <Software />
                    <OperatingSystem />
                    <Browser />
                </div>
                <div className="section" id="section">
                    <Language />
                    <Software />
                    <OperatingSystem />
                    <Browser />
                </div>
                <span id="bottom-indicator">
                    <div 
                        onClick={() => handleClick(0)}
                        className={skills === 0? 'active': ''}></div>
                    <div 
                        onClick={() => handleClick(1)}
                        className={skills === 1? 'active': ''}></div>
                    <div 
                        onClick={() => handleClick(2)}
                        className={skills === 2? 'active': ''}></div>
                    <div 
                        onClick={() => handleClick(3)}
                        className={skills === 3? 'active': ''}></div>
                </span>
                <div className="bottom-container">
                    <ButtonIconMd 
                        click={() => resumeView()}
                        name="resume"
                        icon={documentIcon}/>
                </div>

            </div>
        </div>
    )
}
export default About;

